import styled from 'styled-components';

export const SignUpContainer = styled.div`
  width: 38rem;
`;

export const SignUpTitle = styled.h2`
    font-size: 2.4rem;
    font-weight: 700;
    margin-bottom: 1rem;
`;

export const SignUpParagraph = styled.p`
    font-size: 1.6rem;
`;
